import React from 'react';
import { Link } from 'react-router-dom';

const ImageList = (props) => (
  props.images.map(image =>
    <div key={image.id}>
      <Link to="/images/edit">
        <img
          className='thumbnail'
          src={image.image_url}
          alt={image.id}
          deleteImage={deleteImage}
        />
      </Link>
    </div>
  )
)

export default ImageList
